import React,{Fragment} from 'react'
import {Link} from 'react-router-dom';
import Button from '../Button';
const dashboardactions = () => {
    return (
        <Fragment>
            <div className="dash-buttons">
                <Link to="edit-profile.html" ><Button type='secondary'><i className="fas fa-user-circle text-primary"></i> Edit Profile</Button></Link>
                <Link to="add-education.html"><Button><i className="fas fa-graduation-cap text-primary"></i> Add Education</Button></Link>
            </div>
        </Fragment>
    )
}

export default dashboardactions;
